import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
import AppBar from '@material-ui/core/Drawer';
import Toolbar from '@material-ui/core/Drawer';
import IconButton from '@material-ui/core/Drawer';
import MenuIcon from '@material-ui/core/Drawer';
import Typography from '@material-ui/core/Drawer';

function Navbar() {
    return (
        <AppBar position="static">
  <Toolbar>
    <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
      <MenuIcon />
    </IconButton>
    <Typography variant="h6" className={classes.title}>
      News
    </Typography>
    <Button color="inherit">Login</Button>
  </Toolbar>
</AppBar>
    )

}


ReactDOM.render(
    [

    ],
    document.getElementById('root')
);
